import React from 'react';

export default function FilterInput({ filter, onChange, onBlur }) {
  return (
    <input
      type="text"
      placeholder="Filter by name..."
      value={filter}
      onChange={onChange}
      onBlur={onBlur}
      className="border p-2 mb-4 w-full"
    />
  );
}
